import logo from './logo.svg';
import './App.css';
import {BowserRouter as Router,Routes,Route} from "react-router-dom"
import Nav from './Portfolio/Nav/Nav';
function App() {
  return (
  <Router>
    <Routes>
      <Route exact path='/' element={<Nav/>} />
    </Routes>
  </Router>
  );
}

export default App;
